import PizzaLeft from '../';

function Contact() {
  return (
    <div className='contact'>
    <div className='leftSide' style={{ backgroundImage:`url(${PizzaLeft})` }}></div>

    <div className='rightSide'>
    <h1>Contact Us</h1>

    </div>
    </div>
  )
}

export default Contact;
